('2191','23','6071-7','Sol Hotel Parque San Antonio,Teneriffa',Null,'Hotel der gehobenen Klasse auf Teneriffa zu verkaufen','31135','Das Hotel liegt in einem ruhigen Wohngebiet im Norden von Teneriffa, nur wenige Minuten vom Strand entfernt.\r\nDas Hotel wurde 1968 erstellt und 2002 renoviert. Es ist bekannt für seinen herrlichen Pool im Garten unter Palmen und subtropischen Pflanzen. Die ca 29.000m² konstruierte Fläche verteilt sich auf mehrere Gebäude mit 4 Etagen. Insgesamt bietet dieses gut geführte Hotel 260 Zimmer die alle mit Klimaanlage, Sat TV, Tel und Safe ausgerüstet sind.\r\nWeitere Details erfahren Sie auf Anfrage über unser Büro.\r\nBesichtigungen können organisiert werden bei Vorlage eines Bonitätsnachweises.\r\n\r\n','31136','12000000','106','2014-04-11 10:56:27','110','2014-04-11 10:57:11',Null,'2134','1','1005',1,'1','0',Null,Null,'Preis auf Anfrage','31137',Null,'0','0','0',Null,'2015-11-09 10:06:34',1,'0',Null,Null,Null,Null,'5',0,1,1,'0','1','1',1,1,Null,'31138',Null,'31139',Null,'31140',Null,'31141','Ignacio Iglesias   Portfolio Manager Real Estate Sol Melia Gruppe','31142','0',0,'0');
